import { observable, action } from 'mobx'
const fruits = observable(["apple", "orange"]);

export default class BusinessParametersSetupStore {
  @observable pendingApprovals = ["1","2"]
  // const fruits = observable(["apple", "orange"]);

  @action
  selectProductToDelete (productSelected){
    console.log(productSelected)
    // this.pendingApprovals.push(1)
    fruits.push(productSelected)
    console.log(fruits)
    // console.log(this.pendingApprovals)
  }
}
